function ClubChanged()
{
  var obj = document.getElementById('ClubList');
  location.href = '/index.php?menu=6&categ_id=29&season=14&MySession=031648a015e056c5a75c8241b54c4420&club_id='+obj.value;
}

function CheckCR(e)
{
  if(document.all) e = window.event; // for IE
  if (e.keyCode == 13)
  {
    ClubChanged()
    return false;
  } 
}
function DoSelectSearch(e)
{
  if (document.all) e = window.event; // for IE
  var obj = document.getElementById('ClubList');
  if (obj == null) return;
  if ((e.keyCode>=65 && e.keyCode<=96) ||
       e.keyCode==32 || e.keyCode==52 || e.keyCode==190 ||
      (e.keyCode>=48 && e.keyCode<=57))
  {
    SetSearchString(searchstring+String.fromCharCode(e.keyCode));
    SelectSearch(e, searchstring, 'ClubList');
  }
}

function ClassChanged()
{
  var obj = document.getElementById('ClassList');
  location.href = '/index.php?menu=6&categ_id=29&club_id=269&season=14&MySession=031648a015e056c5a75c8241b54c4420&class_id='+obj.value;
}

function CategChanged()
{
  var obj = document.getElementById('CategList');
  var strict_category_query = '';
  var strict_check = document.getElementById('CategList_strict');
  if (strict_check)
  {
    strict_category_query = '&strict_category='+(strict_check.checked?'1':'0');
  }
  location.href = '/index.php?menu=6&club_id=269&season=14&MySession=031648a015e056c5a75c8241b54c4420&categ_id='+obj.value+strict_category_query;
}

function OnPlayerStatusChanged()
{
  var obj = document.getElementById('PlayerStatus');
  location.href = '/index.php?menu=6&categ_id=29&club_id=269&season=14&cur_page=1&MySession=031648a015e056c5a75c8241b54c4420&player_status='+obj.value;
}

td.script:
function OnIndexSearch(supp_query)
{
  var filt_index = document.getElementById('filt_index');
  var new_href = '/index.php?menu=6&categ_id=29&club_id=269&season=14&cur_page=1&MySession=031648a015e056c5a75c8241b54c4420&filt_index='+filt_index.value;
  if (typeof(supp_query) != 'undefined' && supp_query != '')
  {
    new_href += supp_query;
  }
  location.href=new_href;
}
function check_key()
{
  if (event.keyCode >= 8 && event.keyCode <= 9) return true;
  if (event.keyCode >= 16 && event.keyCode <= 18) return true;
  if (event.keyCode >= 33 && event.keyCode <= 40) return true;
  if (event.keyCode >= 45 && event.keyCode <= 46) return true;
  if (event.keyCode >= 48 && event.keyCode <= 57) return true;
  if (event.keyCode >= 96 && event.keyCode <= 105) return true;

  if (event.keyCode == 13)
  {
    document.getElementById('go_to_props').click();
  }

  return false;
}

function OnNameSearch()
{
  var LastNameFilter = document.getElementById('LastNameFilter');
  var FirstNameFilter = document.getElementById('FirstNameFilter');
  location.href='/index.php?menu=6&categ_id=29&club_id=269&season=14&cur_page=1&MySession=031648a015e056c5a75c8241b54c4420&filt_lname='+escape(LastNameFilter.value)+'&filt_fname='+escape(FirstNameFilter.value);
}
function check_key_name()
{
  if (event.keyCode == 13)
  {
    document.getElementById('go_name_search').click();
    return false;
  }
  return true;
}

